import React from "react";
import "./Home.css";
import {
  Navbar,
  Nav,
  NavDropdown,
  Form,
  FormControl,
  Button,
  Carousel,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class Home extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <Carousel className="my-carousel">
          <Carousel.Item>
            <img
              className="d-block"
              src="/img/air-freight-1.jpg"
              alt="First slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block"
              src="/img/air-freight-2.jpg"
              alt="Third slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block"
              src="/img/shutterstock_308983268.jpg"
              alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}

export default Home;
